import styled from "styled-components";
import { Link } from "react-router-dom";

export const NavBar = () => {
  return (
    <NavWrapper>
      <div className="logo">UMC Movie</div>
      <div className="link">
        <span>회원가입</span>
        <Link to="/popular">Popular</Link>
        <Link>Now Playing</Link>
        <span>Top Rated</span>
        <span>Upcoming</span>
      </div>
    </NavWrapper>
  );
};

const NavWrapper = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
  padding: 10px;
  height: 30px;
  border: 1px solid #fff;

  .logo {
    font-weight: 600;
    font-size: 18px;
  }

  .link {
    display: flex;
    gap: 20px;
    span,
    Link {
      &:hover {
        cursor: pointer;
        color: #e4b940;
        font-weight: 700;
      }
    }
  }
`;
